import { Container } from "react-bootstrap";


export default function ViewOffers() {
    const Authentication = localStorage.getItem('Authentication');
    const location = useLocation();
    const navigate = useNavigate();

    return (
        <Container>
            <h1>Book Offers</h1>
        </Container>
    );
}
